import React from 'react';
import { makeStyles } from '@material-ui/core';
import Menu from '@material-ui/core/Menu';
import MenuItem from '@material-ui/core/MenuItem';
import { ListItemIcon, ListItemText } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import FastfoodIcon from '@material-ui/icons/Fastfood';
import Avatar from '@material-ui/core/Avatar';

//Custom Imports 
import Order from './data';

//Retrieve Data from DB
const rows = [
    Order('Atria'),
    Order('Callisto'),
    Order('Dione'),
    Order('Ganymede'),
    Order('Hangouts Call'),
    Order('Luna'),
    Order('Phobos'),
    Order('Pyxis'),
    Order('Sedna'),
    Order('Titania'),
    Order('Triton'),
    Order('Umbriel'),

];

const useStyles = makeStyles((theme) => ({
    primary: {
        color: '#fff',
        backgroundColor: '#3f50b5',
    },
}));

const ITEM_HEIGHT = 48;

export default function NotifMenu({ notifAnchor, handleClose, isNotifOpen }) {
    const classes = useStyles();
    const today = new Date(),
    month = today.getFullYear() + '-' + (today.getMonth() + 1) + '-' + today.getDate(),
    time = today.getHours() + ':' + today.getMinutes() + ':' + today.getSeconds();


    const date = {
        currentMonth: month, 
        currentTime: time
    }
    return (
        <div>
            <Menu
                id="long-menu"
                anchorEl={notifAnchor}
                keepMounted
                open={isNotifOpen}
                onClose={handleClose}
                getContentAnchorEl={null}
                anchorOrigin={{ vertical: "bottom", horizontal: "center" }}
                transformOrigin={{ vertical: "top", horizontal: "center" }}
                PaperProps={{
                    style: {
                        maxHeight: ITEM_HEIGHT * 4.5,
                        width: '30ch',
                    },
                }}
            >
                {rows.map((row) => (
                    <MenuItem key={row.order} onClick={handleClose}>
                        <ListItemIcon>
                            <Avatar className={classes.primary}>
                                <FastfoodIcon />
                            </Avatar>
                        </ListItemIcon>
                        <ListItemText 
                        primary={<Typography variant="inherit">{row.order}</Typography>} 
                        secondary={date.currentMonth}
                        />
                    </MenuItem>
                ))}
            </Menu>
        </div>
    );
}
